import React from "react";

const UserInformation =({userData}) => {  
  return (
    <table className="table">
  <thead>
    <tr>
      <th scope="col">id</th>
      <th scope="col">winner</th>
      <th scope="col">date</th>
    </tr>
  </thead>
  <tbody>
}

    <tr >
      <td>userData.id</td>
      <td>userData.winner</td>
      <td>userData.date</td>
    </tr>

  </tbody>
</table>
)

}
console.log (this.props.userData);








export default UserInformation;
